import logo from './logo.png';

function Footer() {
  return (
    <div>
      <footer className="pt-[160px] px-[0] pb-[48px] h-auto flex-wrap bottom-[0] absolute">
        <div className="w-full flex justify-center"><img src={logo} alt="Logo" /></div>
        <div>
        <a>Style Guide</a> | <a>Customize</a>
        </div>
      </footer>
    </div>
  );
}

export default Footer;
